const Wrapper = styled.section`
  display: flex;
  align-items: center;
  justify-content: center;

  & button {
    margin-left: 3em;
  }
`;

const Header = () => {
  const { addRegularMessage } = useScoreCard();

  return (
    <Wrapper>
      <Typography variant="h2">Podcaster Summurizer</Typography>
    </Wrapper>
  );
};

export default Header;
